import React from 'react';

const Card = (props) => {
  const { id, name, username, email } = props;
  return (
    <div className="bg-light-green dib br3 pa3 ma2 grow shadow-5">
      <img alt="robot" src={`https://robohash.org/${id}?size=200x200`} />
      <div>
        <h2>Name</h2>
        <p>Email</p>
      </div>
    </div>
  );
};

export default Card;
